import React from 'react';
import {Typography, Box} from '@mui/material';
import './home.css';

const Home = () => {
    return (
        <div className="group-stage-container">
            {/* Section pour l'affiche du tournoi */}
            <Typography variant="h5">Sélectionnez une phase pour voir les groupes ou les éliminations
                directes.</Typography>

            <blockquote className="tiktok-embed" cite="https://www.tiktok.com/@bif.bif" data-unique-id="bif.bif"
                        data-embed-type="creator" style="max-width: 780px; min-width: 288px;">
                <section><a target="_blank" href="https://www.tiktok.com/@bif.bif?refer=creator_embed">@bif.bif</a>
                </section>
            </blockquote>
            <script async src="https://www.tiktok.com/embed.js"></script>
        </div>
    )
};

export default Home;
